@_ainhoacsobrino @cristianchiclan Aquí hay mucho adulto con reacciones adolescentes. El día que maduremos y dejemos de agredirnos, cambiaremos el mundo. Venga!  

Sin sentido del humor estamos muertos en vida. Lo peor para un español! 

Tanta formación y sin educación para respetar al diferente? De locos!

